<span class="line"><span style="color:#6272A4;"># IdentityFile: \u79C1\u94A5\u8BC1\u4E66\u6587\u4EF6\u4F4D\u7F6E\uFF0C\u9ED8\u8BA4\u4F4D\u7F6E\u662F~/.ssh/id_rsa\uFF0C\u5982\u679C\u91C7\u7528\u9ED8\u8BA4\u8BC1\u4E66\uFF0C\u53EF\u4E0D\u586B\u6B64\u9879</span></span>
